import React from 'react'

export default function Quiz(){
    return (
        React.useEffect(function(){
            fetch(`https://opentdb.com/api.php?amount=5`)
            .then(function(response){
                return response.json()
            })
            .then(function(data){
                console.log(data)
            })
        }, [])
    )
}
